import React from "react";
import ReactDom from "react-dom";
import "./index.css";
import bro from"./Used Images/bro.png";
import OsumareLogo from "./OsumareLogo.png";

function Nav(){
    return(<>
    <div className="bg-dark">
      <h1>kffjfb</h1>

  
     <nav class="navbar fixed-top">
  <div class="container-fluid">
    <a class="navbar-brand"> <img
    src={OsumareLogo}
    /></a>
      <button class="btn btn-outline-success" type="submit">Contect</button>
  </div>
</nav>

</div>
   </>);
}
export default Nav;
